  from National Oceanic and Atmospheric Administration (NOAA) Survey H12013 Off the
  Entrance to the Connecticut River in Northeastern Long Island Sound (H12013_INT2M_GEO.TIF,
  Geographic, WGS84)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 15,\n\t\t\"recent\":
